  let resetValueIfNull = false;

  const currentUser = params.user;
  const currentUserName = currentUser && currentUser.name; // fallback to .name instead of .displayName

  const condition11 = new imports.rulesConfig.RuleCondition({ encounter, formElement })
    .when.valueInEncounter("c118aa80-66ad-4996-8847-bb9f02a89287")
    .containsAnswerConceptName("1648f8ad-0136-455f-9fba-2644e12baa61")
    .matches();

  visibility = condition11;

  if (visibility) {
    const allIndividuals = db.objects('Individual') || [];

    const validVolunteers = allIndividuals.filter(function(ind) {
      return (
        ind.subjectType &&
        ind.subjectType.name === 'Volunteer' &&
        ind.voided === false &&
        ind.createdBy === currentUserName
      );
    });

    const validUUIDs = validVolunteers.map(function(ind) {
      return ind.uuid;
    });

    const allVolunteers = Array.from(allIndividuals)
          .filter(ind => ind.subjectType && ind.subjectType.name === 'Volunteer' && ind.voided === false)
          .map(ind => ind.uuid);

    if (validUUIDs && validUUIDs.length > 0) {
      answersToShow.push(...validUUIDs);
    } else {
      answersToShow = [""];
      value=null;
      resetValueIfNull = true;
      validationErrors.push("No Volunteers present to select from. Please register a Volunteer before proceeding.");
    }
  }

  return new imports.rulesConfig.FormElementStatus(
    formElement.uuid,
    visibility,
    value,
    answersToSkip,
    validationErrors,
    answersToShow,
    resetValueIfNull
  );
};

